import './styles.scss';

function Login() {
  return (
    <div className='page-login'>
      <div className='page-login-vf page-login-content'>
        <img src="/assets/library.png" alt="logo"/>

        <form className='page-login-vf page-login-form'>
          <input className='page-login-input' placeholder='User' type="text"/>
          <input className='page-login-input'  placeholder='Password' type="password"/>
          <button className='page-login-btn' type='submit'>Login</button>
        </form>
      </div>
    </div>
  );
}

export default Login;
